import React from "react";

const model = {
    iPhone: ['iPhone 3', 'iPhone 4', 'iPhone 5', 'iPhone 6', 'iPhone 7', 'iPhone 8', 'iPhone 9'
            , 'iPhone x', 'iPhone 11', 'iPhone 12', 'iPhone 13']
}

const phoneModel = () => {

    model.iPhone.map(item => {
        return 
            <div>
                <h2>iPhone</h2>
                <p>Model</p>
            </div>
    })
}

export default phoneModel;
